import axios from 'axios';
import React, { Component } from 'react';

class Title extends Component {
  componentDidMount(){
    axios.get("https://jsonplaceholder.typicode.com/users")
    .then(
      function r(resp){
        console.log(resp.data)
      }
    )
  }
  render(){
    return (
      <div>
          <h1>Title I </h1>
      </div>
    );
  }
}

export default Title;
